function DialogFullReader() {
	var me = this;
	this.pos = null;
	this.find = function (imgref) {
		if (!imgref) { imgref = a1lib.bindfullrs(); }
		if (!imgref) { return false;}

		var pos = a1lib.findsubimg(imgref, DialogFullReader.boxtl);

		var boxes = [];
		for(var a in pos) {
			var p = pos[a];
			if (a1lib.findsubimg(imgref, DialogFullReader.boxtr, null, p.x + 492, p.y, 16, 16).length != 0) {
				boxes.push(p);
			}
		}
		if (boxes.length == 0) { return false; }
		var box = boxes[0];
		if (boxes.length > 1) { console.log("More than one chat box found"); }

		me.pos = new Rect(box.x + 1, box.y + 1, 506, 130);
		return me.pos;
	}

	var ensureimg = function (imgref) {
		if (!me.pos) { return false;}
		if (imgref && new Rect(imgref).contains(me.pos)) { return imgref; }
		return a1lib.bindregion(me.pos.x, me.pos.y, me.pos.width, me.pos.height);
	}

	this.read = function (imgref) {
		imgref = ensureimg(imgref);
		if (!imgref) { return false; }

		var r = { text: null, opts: null, title: null };
		r.title = readTitle(imgref);
		if (checkDialog(imgref)) {
			r.text = me.readDialog(imgref, true);
			return r;
		}
		else {
			var opts = findOptions(imgref);
			if (opts.length != 0) {
				r.opts = me.readOptions(imgref, opts);
				return r;
			}
			else {
				return null;
			}
		}
	}

	var readTitle = function (imgref) {
		var buf = imgref.toData(me.pos.x, me.pos.y, me.pos.width, 32);
		var pos = OCR.findChar(buf, DialogFullReader.fontheavy, [255, 203, 5], Math.round(me.pos.width / 2) - 10, 16, 20, 4);
		if (!pos) {
			return "";
		}
		var read = OCR.readLine(buf, DialogFullReader.fontheavy, [255, 203, 5], pos.x, pos.y, true, true);
		return read.text;
	}

	var checkDialog = function (imgref) {
		var locs = [];
		locs = locs.concat(a1lib.findsubimg(imgref, DialogFullReader.continueimg, null, me.pos.x - imgref.x, me.pos.y - imgref.y, me.pos.width, me.pos.height));
		locs = locs.concat(a1lib.findsubimg(imgref, DialogFullReader.continueimgdown, null, me.pos.x - imgref.x, me.pos.y - imgref.y, me.pos.width, me.pos.height));
		return locs.length != 0;
	}

	this.readDialog=function(imgref,checked){
		imgref = ensureimg(imgref);
		if (!imgref) { return false; }
		if (!checked) { checked = checkDialog(imgref); }
		if (!checked) { return false; }


		var lines = [];
		var buf = imgref.toData(this.pos.x, this.pos.y + 33, this.pos.width, 80);
		for (var y = 0; y < buf.height; y++) {
			var hastext = false;
			for (var x = 200; x < 300; x++) {
				var i = x * 4 + y * 4 * buf.width;
				if (buf.data[i] + buf.data[i + 1] + buf.data[i + 2] < 50) {
					hastext = true;
					break;
				}
			}
			if (hastext) {
				var chr = null;
				chr = chr || OCR.findChar(buf, DialogFullReader.fontmono, [0, 0, 0], 192, y + 5, 12, 3);
				chr = chr || OCR.findChar(buf, DialogFullReader.fontmono, [0, 0, 0], 246, y + 5, 12, 3);
				chr = chr || OCR.findChar(buf, DialogFullReader.fontmono, [0, 0, 0], 310, y + 5, 12, 3);
				if (chr) {
					var read = OCR.readLine(buf, DialogFullReader.fontmono, [0, 0, 0], chr.x, chr.y, true, true);
					if (read.text.length >= 3) {
						lines.push(read.text);
					}
					y = chr.y + 5;
				}
			}
		}
		
		return lines;
	}

	var findOptions = function (imgref) {
		var locs = [];

		var a = a1lib.findsubimg(imgref, DialogFullReader.chatimg);
		for (var b in a) { a[b].hover = false; }
		locs = locs.concat(a);

		var a = a1lib.findsubimg(imgref, DialogFullReader.chatimghover);
		for (var b in a) { a[b].hover = true; }
		locs = locs.concat(a);

		var a = a1lib.findsubimg(imgref, DialogFullReader.chatimgactive);
		for (var b in a) { a[b].active = true; }
		locs = locs.concat(a);

		return locs;
	}

	this.readOptions = function (imgref, locs) {
		var a, b, c, locs, x, y, dx, dy, checkline, r, i;
		imgref = ensureimg(imgref);
		if (!imgref) { return false; }
		var buf = imgref.toData();

		if (!locs) { locs = findOptions(imgref); }
	
		var props = {
			normal: { col: [194, 70, 21], gap: 33 },
			hover: { col: [255, 94, 31], gap: 25 },
			active: { col: [190, 57, 6], gap: 33 }
		};
		r = [];
		for (a in locs) {
			dx = locs[a].x + 30;
			dy = locs[a].y + 6;
			checkline = imgref.toData(dx, dy, Math.min(500, imgref.width - a), 1);
			c = false;
			for (x = 0; x < checkline.width; x++) {
				i = x * 4;
				var prop = props[(locs[a].hover ? "hover" : (locs[a].active ? "active" : "normal"))];

				if (coldiff(checkline.data[i], checkline.data[i + 1], checkline.data[i + 2],prop.col[0],prop.col[1],prop.col[2] ) < 50) {
					if (c) { c.w = x + prop.gap; }
					break;
				}

				if (!c && coldiff(checkline.data[i], checkline.data[i + 1], checkline.data[i + 2], 174, 208, 224) < 100) {
					var text = "";
					var chr = OCR.findChar(buf, DialogFullReader.fontmono, [174, 208, 224], dx + x + 2 - imgref.x, dy + 3 - imgref.y, 30, 1);
					if (chr) {
						var read = OCR.readLine(buf, DialogFullReader.fontmono, [174, 208, 224], chr.x, chr.y, true, true);
						var text = read.text;
					}
					c = { str: text, x: dx + x, y: dy, w: 200, buttonx: dx - 31, hover: !!locs[a].hover, active: locs[a].active };
				}
			}
			if (c) { r.push(c); }
		}
		r.sort(function (a, b) { return a.y - b.y; });
		return r;
	}
}